                    es: "Las IDR est&aacute;n destinadas a las personas sanas. Los profesionales sanitarios deben adaptar los valores a las necesidades de las personas con enfermedades o afecciones espec&iacute;ficas que pudieran alterar sus necesidades nutricionales diarias.",
