                    lt: "Tam tikros maisto medÅ¾iagos poreikis kiekvienam Å¾mogui yra skirtingas. Vidutinis poreikis ir gyventojÅ³ suvartotini maistiniÅ³ medÅ¾iagÅ³ kiekiai apibÅ«dina poreikiÅ³ pasiskirstymÄ… gyventojÅ³ tarpe. Å ie rodikliai nurodo, kiek tam tikros maisto medÅ¾iagos turi atitinkamai suvartoti pusÄ— arba didÅ¾ioji dalis (97,5%) gyventojÅ³, kad patenkintÅ³ savo dienos poreikÄ¯. Darant prielaidÄ…, kad individualÅ«s tam tikros medÅ¾iagos poreikiai yra nustatyti populiacijos mastu, gyventojÅ³ suvartotini maistiniÅ³ medÅ¾iagÅ³ kiekiai apskaiÄiuojami prie vidutinio poreikio pridÄ—jus jo standartinÄ¯ nuokrypÄ¯, padaugintÄ… iÅ¡ dviejÅ³. Standartinis nuokrypis praktikoje yra retai Å¾inomas, todÄ—l gyventojÅ³ suvartotiniems maistiniÅ³ medÅ¾iagÅ³ kiekiams nustatyti naudojamas numatytasis variacijos koeficientas. Jei kuriai nors maisto medÅ¾iagai neÄ¯manoma nustatyti vidutinÄ¯ poreikÄ¯, gyventojÅ³ suvartotinÅ³ maistiniÅ³ medÅ¾iagÅ³ kiekiÅ³ gauti neÄ¯manoma.",
