                    mk: "ÐšÐ°Ð´Ðµ Ð¼Ð¾Ð¶Ð°Ð¼ Ð´Ð° Ð½Ð°Ñ˜Ð´Ð°Ð¼ Ð½Ð°ÑƒÑ‡Ð½Ð¸ Ð¼Ð¸ÑÐ»ÐµÑšÐ° Ð½Ð° Ð•Ð¤Ð¡Ð Ð·Ð° DRV?"
