                    de: 'Die von der EFSA verwendeten Daten zur Berechnung der N&auml;hrstoffaufnahme verschiedener Altersgruppen in europ&auml;ischen L&auml;ndern finden sich in der <a target="_blank" href="http://www.efsa.europa.eu/en/microstrategy/food-composition-data">Datenbank &uuml;ber die Zusammensetzung von Lebensmitteln</a> der Beh&ouml;rde sowie ihrer <a target="_blank" href="http://www.efsa.europa.eu/de/data/food-consumption-data">Umfassenden Europ&auml;ischen Datenbank &uuml;ber den Lebensmittelverzehr</a>.',
