                    en: "The reference value for sodium for adults is called â€˜safeâ€™ because it takes account of the evidence describing the relationship between sodium intake and CVD risk in the general population and â€˜adequateâ€™ in line with the definition of an Adequate Intake. The value provides guidance on a level of sodium intake compatible with good health that can inform population goals for sodium. However, the value has limited utility for assessing and planning the diet of individuals. At the individual level, if the usual intake of sodium exceeds this value, it could be associated with an increased risk of cardiovascular diseases, including concurring risk factors such as primary hypertension. The values for the other population groups are considered safe and adequate intakes of sodium, consistent with the reference value set for adults.<br>The reference values for chloride are set at values equimolar to the reference values for sodium, under the consideration that the main dietary source of chloride intake is sodium chloride. The reference values for chloride are called â€˜safeâ€™ and â€˜adequateâ€™ consistent with the use made of these terms for sodium.",
                    it: 'Il valore di riferimento per il sodio per gli adulti Ã¨ detto "sicuro" perchÃ© tiene conto delle evidenze che descrivono il rapporto tra assunzione di sodio e rischio di CVD nella popolazione in genere e "adeguato" in linea con la definizione di assunzione adeguata. Il valore dÃ  indicazioni per un livello di assunzione di sodio compatibile con un buono stato di salute che puÃ² formare la base per fissare obiettivi di assunzione di sodio per la popolazione. Tuttavia il valore ha un\'utilitÃ  limitata per valutare e pianificare la dieta dei singoli individui. A livello individuale, se l\'assunzione abituale di sodio supera questo valore, potrebbe essere collegata a un aumento del rischio di malattie cardiovascolari, compresi i fattori di rischio concomitanti come l\'ipertensione primaria. I valori per le altre fasce della popolazione sono considerati assunzioni di sodio sicure e adeguate, coerenti con il valore di riferimento fissato per gli adulti.<br>I valori di riferimento per il cloruro sono fissati a valori equimolari ai valori di riferimento per il sodio, tenuto conto che la principale fonte alimentare di  assunzione di cloruro Ã¨ il cloruro di sodio. I valori di riferimento per il cloruro sono detti "sicuri" e "adeguati" coerentemente con l\'uso che si fa di questi termini per il sodio (cfr. sodio).',
                    fr: "On qualifie de Â« sans danger Â» la valeur de rÃ©fÃ©rence pour le sodium pour les adultes car elle est Ã©tayÃ©e par des preuves scientifiques dÃ©crivant la relation entre l'apport en sodium et le risque de maladies cardiovasculaires dans la population gÃ©nÃ©rale, et de Â« satisfaisant Â» conformÃ©ment Ã  la dÃ©finition d'un apport suffisant. Cette valeur de rÃ©fÃ©rence fournit lâ€™indication d'un niveau de consommation de sodium compatible avec une bonne santÃ© qui peut informer les objectifs de santÃ© publique en matiÃ¨re de sodium destinÃ©s Ã  la population gÃ©nÃ©rale. Cependant, cette valeur a une utilitÃ© limitÃ©e dans lâ€™Ã©valuation et la planification des rÃ©gimes alimentaires individuels. Au niveau individuel, si l'apport habituel en sodium dÃ©passe cette valeur, il peut Ãªtre associÃ© Ã  un risque accru de maladies cardiovasculaires, y compris certains facteurs de risque concordants tels que l'hypertension primaire. Les valeurs pour les autres groupes de population sont considÃ©rÃ©es comme des apports en sodium sans danger et adÃ©quats, conformÃ©ment Ã  la valeur de rÃ©fÃ©rence dÃ©finie pour les adultes.<br>Les valeurs de rÃ©fÃ©rence pour le chlorure sont fixÃ©es Ã  des valeurs Ã©quimolaires aux valeurs de rÃ©fÃ©rence pour le sodium, Ã©tant entendu que la principale source alimentaire d'apport en chlorure est le chlorure de sodium. Les valeurs de rÃ©fÃ©rence pour le chlorure sont qualifiÃ©es de Â« sans danger Â» et de Â« satisfaisantes Â», conformÃ©ment Ã  lâ€™utilisation faite de ces termes pour le sodium (voir sodium).",
                    de: "Der Referenzwert fÃ¼r Natrium fÃ¼r Erwachsene wird als â€žsicherâ€œ bezeichnet, denn er berÃ¼cksichtigt die Nachweise, welche die Beziehung zwischen Natrium-Aufnahme und dem Risiko fÃ¼r HKE in der allgemeinen BevÃ¶lkerung beschreiben, und als â€žadÃ¤quatâ€œ im Einklang mit der Definition einer Angemessenen Aufnahmemenge. Der Wert dient als Orientierung fÃ¼r einen mit guter Gesundheit assoziierten Aufnahmewert fÃ¼r Natrium, der als Grundlage zur Festlegung von Zielen fÃ¼r die BevÃ¶lkerung bezÃ¼glich Natrium dienen kann. Allerdings ist der Wert nur von bedingtem Nutzen, um die ErnÃ¤hrung von Einzelpersonen zu bewerten und zu planen. Wenn die Ã¼bliche Aufnahme von Natrium diesen Wert auf individueller Ebene Ã¼berschreitet, kÃ¶nnte dies mit einem erhÃ¶hten Risiko fÃ¼r Herz-Kreislauf-Erkrankungen, einschlieÃŸlich gleichzeitiger Risikofaktoren wie primÃ¤re Hypertonie, in Verbindung gebracht werden. Die Werte fÃ¼r die anderen BevÃ¶lkerungsgruppen gelten als sichere und adÃ¤quate Natrium-Aufnahme, entsprechend dem Referenzwert fÃ¼r Erwachsene.<br>Die Referenzwerte fÃ¼r Chlorid werden als Ã¤quimolare Werte zu den Natrium-Richtwerten festgesetzt, unter BerÃ¼cksichtigung der Tatsache, dass in der ErnÃ¤hrung die Aufnahme von Natriumchlorid die Hauptquelle fÃ¼r Chlorid ist. Die Referenzwerte fÃ¼r Chlorid werden als â€žsicherâ€œ und â€žadÃ¤quatâ€œ bezeichnet, entsprechend der Verwendung dieser Begriffe im Zusammenhang mit Natrium (siehe Natrium).",
